import React from 'react';

const SuccessCheckout = () => {
    return (
        <div id="page-404" className="blog">
            <div className="main-content">
                <div id="wrapper-site">
                    <div id="content-wrapper">
                        <h1>Đặt hàng thành công</h1>
                    </div>
                </div>
            </div>

        </div>
    );
};

export default SuccessCheckout;
